  \"Mozambique - National Land Administration Interventions\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-11-04T20:01:56.715131\",\n\t\"name\": \"mozambique-national-land-administration-interventions\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" n        The objective of this study is
  to establish a baseline for the impact evaluation of the institutional strengthening
  of the land administration system in Mozambique, particularly associated with  the:
  a) number of land conflicts, b) number of land transactions and c) amount of time
  transpired between the application date and issuance date for clear legal rights
  for access and land use in district and municipalities. The land transaction (purchase,
  rentals, and mortgage) is an indicator of land market growth and will be measured
  using the administrative records at Land Administration Units (LAUs). The u201cDUAT
  transactionu201d time is defined as the time period between DUAT application and
  issuance by municipality offices and indicator of efficiency in providing land administration
  services. To achieve this objective, data from two different sources was obtained,
  including district and municipalities. In the municipalities, data was retrieved
  from the land administrative offices records in 16 municipalities (9 treatment and
  7 control sites). Essentially, records on land registration was retrieved, copied
  to PDFs and entered into digital form. The second data source is the administrative
  data obtained from the provincial land administrative offices (SPGCs) in the four
  provinces in North-Central Mozambique where the Millennium Challenge Account implemented
  its land tenure project. Note that, data obtained in the districts was in digital
  form (Access) converted to Stata for analysis.  A total of 11,311 land titles were
  compiled from the existing records from the two data sources.n      \",\n\t\"license_title\":
